import React from 'react';
import { Link } from 'react-router-dom';
import './style.css';

function About() {

    return (

        <div className="page">

            <div className="about">

                <img src="/portfolio/assets/images/casual-headshot-portrait.jpg" alt="personal portrait" className="portrait"></img>

                <div className="about-bio">

                    {window.innerWidth > 1500 ?
                        // desktop
                        <h2>Hi, my name is Eli and I'm a software developer.</h2>
                        :
                        // mobile
                        <>
                            <h2>Hi, my name is Eli and</h2>
                            <h2>I'm a software developer.</h2>
                        </>
                    }

                    <h3>Front End Web Developer with a background in design. Trained at the University of Washington Coding Bootcamp and earned a Certificate in Full Stack Web Development. Innovative problem-solver passionate about developing apps; focused on user-centered design and mobile-first development. Strengths in attention to detail, quick learning, teamwork, and building projects from ideation to execution.</h3>

                    <div className="button-block">

                        <Link to="../work" className="button">
                            <button>Work</button>
                        </Link>

                        <Link to="../contact" className="button">
                            <button>Contact</button>
                        </Link>

                        <a href="./assets/resume/eli-wood-resume.pdf" target="_blank" rel="noreferrer" className="button">
                            <button>Resume</button>
                        </a>

                    </div>

                </div>

            </div>

        </div>

    );

};

export default About;
